(1, 'Wooden Sofa', 'wooden-sofa', 'Best Sofa in the world', '1000', '800', '<p><span style=\"color: #545454; font-family: arial, sans-serif; font-size: small;\">Hey there guys, I\'ve been using&nbsp;</span><span style=\"font-weight: bold; color: #6a6a6a; font-family: arial, sans-serif; font-size: small;\">Laravel</span><span style=\"color: #545454; font-family: arial, sans-serif; font-size: small;\">&nbsp;for a couple of months by now. Do love it. However, never had the need to save&nbsp;</span><span style=\"font-weight: bold; color: #6a6a6a; font-family: arial, sans-serif; font-size: small;\">rich text</span><span style=\"color: #545454; font-family: arial, sans-serif; font-size: small;\">, but as today I\'ve be. ... When I get the text in the view I get the text without any&nbsp;</span><span style=\"font-weight: bold; color: #6a6a6a; font-family: arial, sans-serif; font-size: small;\">formatting</span><span style=\"color: #545454; font-family: arial, sans-serif; font-size: small;\">, meaning no line ... I just tried inserting HTML to a text field in&nbsp;</span><span style=\"font-weight: bold; color: #6a6a6a; font-family: arial, sans-serif; font-size: small;\">DB</span><span style=\"color: #545454; font-family: arial, sans-serif; font-size: small;\">&nbsp;and outputting it with {!! ... !!} , works fine.</span></p>', 'Wooden Sofa', 'Wood Color', 4, '2018-11-03 09:09:45', '2019-01-29 02:53:38', 'products\\November2018\\uiaUA140D3wBPWrQ3fbd.jpg', NULL, NULL, NULL, NULL, 4, NULL, NULL, '2019-01-02 00:00:00'),
(2, 'Wooden Bed', 'wooden-bed', 'Best bed in the world', '1000', '800', '<p><span style=\"color: #242729; font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 15px;\">&nbsp;had a similar problem. But the problem was in the file name \'.htaccess\', because the Windows doesn\'t let the file\'s name begin with a \".\", the solution was rename the file with a CMD command. \"rename c:\\xampp\\htdocs\\htaccess.txt .htaccess</span></p>', 'Wooden Bed', 'Wood', 7, '2018-11-05 06:13:59', '2018-11-08 14:09:58', 'products\\November2018\\gtUqf7O1FqOTM8aN84y5.JPG', 'products\\November2018\\BkCJkJi1hPLAI6hDdO39.jpg', 'products\\November2018\\HbbLmy6uRmMyuRHW3iYl.jpg', NULL, NULL, 3, 2, NULL, NULL),
(5, 'Master Bed v4', 'master-bed-v4', 'In publishing and graphic design, lorem ipsum is a placeholder text used to demonstrate the', '500', '499.9', '<div>\r\n<h2>What is Lorem Ipsum?</h2>\r\n<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a <em><span style=\"text-decoration: underline;\">type</span></em> specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</p>\r\n</div>', 'Bed', 'Wooden', 5, '2018-11-10 13:06:03', '2018-11-10 13:06:03', 'products\\November2018\\isPQYZ2CSaV6zxAx8QjF.jpg', 'products\\November2018\\d851RKwCDBaBhfhXkOC3.jpg', 'products\\November2018\\HPc3V5aXEcML8qJ9HSah.png', NULL, NULL, 25, NULL, NULL, '2018-12-30 00:00:00'),
