(7, 'All star bed', 'all-star-bed', 'The All Star Twin/Twin bunk bed is metal, available in Silver, Black White or Red.', '99', '88', '<p>&nbsp;</p>\r\n<p>The <strong>All Star</strong> Twin/Twin bunk bed is metal, available in Silver, Black White or Red.</p>\r\n<ul>\r\n<li style=\"text-align: left;\">It has 2 inch posts and 15 slats for each bed.</li>\r\n</ul>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<ol>\r\n<li>The All Star Twin/Twin bunk bed is metal, available in Silver, Black White or Red.</li>\r\n</ol>\r\n<ol>\r\n<li>It has 2 inch posts and 15 slats for each bed.</li>\r\n</ol>\r\n<p class=\"MsoNormal\">&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'Bed', 'Brown', 5, '2018-11-29 04:42:41', '2018-11-29 04:42:41', 'products\\November2018\\BJR99PSwc7jxONs8QeoS.jpg', NULL, NULL, NULL, NULL, 100, 10, NULL, '2018-12-25 00:00:00');
